import styled from "styled-components";

const Ground = styled.section`
  width: 100vw;
  height: 100vh;
  border: 1px black solid;
  display: flex;
  justify-content: center;
`

const HeaderDiv = styled.section`
  margin-top: 20px;
  min-width: 850px;
  height: 100px;
  border: 1px black solid;
`;

function App() {
  return (
    <Ground>
      <HeaderDiv />
    </Ground>
  );
}

export default App;
